def combos(n, m = 1):
    if n < m:return []
    res = [[n]]
    for i in xrange(m, n):
        l = [i]
        for j in combos(n - i, i):
           res += [l + j]
    return res

def combos(n):
    def partition(residue, acc):
        if residue == 0:
            yield acc[1:]
        else:
            for part in range(acc[-1], residue + 1):
                for result in partition(residue - part, acc + [part]):
                    yield result

    return list(partition(n, [1]))

def combos(n,r=0):
    if n < 2 or r == 1: return [[1]*n]
    return sum([[c+[i] for c in combos(n-i,i)] for i in range(1,min(n,r or n)+1)],[])

import itertools
def combos(n):
    return [[1]] if n == 1 else list(i for i,_ in itertools.groupby(sorted([[n]] + [sorted(j+[i]) for i in range(1, n) for j in combos(n-i)])))

def combos(n):
    return list(part(n))

def part(n, k=1):
    yield [n]
    for i in range(k, n//2 + 1):
        for p in part(n-i, i):
            yield [i] + p

def combos(n):
    mom_a = [[1]]
    i = 2
    while i <= n:
        tmp_a = [[i]]
        for lst in mom_a:
            tmp_a.insert(0,[1]+lst)
        for lst in mom_a:
            for j in range(len(lst)):
                tmp_lst = sorted(lst[:j] + [lst[j]+1] + lst[j+1:])
                if not tmp_lst in tmp_a: tmp_a.append(tmp_lst)
        mom_a = tmp_a
        i += 1
    return mom_a

def combos(n):
    return combos_between(1, n)
def combos_between(m, n):
    if n == 1:
        return [[1]]
    result = [[n]]
    for x in range(m, n // 2 + 1):
        for combo in combos_between(x, n - x):
            result.append([x] + combo)
    return result

import itertools
d = {1:[[1]]}
def combos(n):
    if n not in d:
        d[n] = list(i for i,_ in itertools.groupby(sorted([[n]] + [sorted(j+[i]) for i in range(1, n) for j in combos(n-i)])))
    return d[n]
